//Funcio que pinta el mapa (variable TileMap) en les seves diferents capes

	var img = new Image();
	img.src = "images/game/tile.png";//imatge del mapa

function drawTiles(ctx0, ctx1, ctx2) {//rep 3 context 2d del canvas on volem pintar
	var ctxCanvasMap = new Array();
	ctxCanvasMap[0]=ctx0;
	ctxCanvasMap[1]=ctx1;
	ctxCanvasMap[2]=ctx2;
	
	var TileWidth = TileMap.tilewidth,
	nTileHeight = TileMap.tileheight,
	nMapWidth = TileWidth * TileMap.width,
	Layers = TileMap.layers,
	aLayersLen = Layers.length,
	nImageCols = img.width / TileWidth,
	CurrentLayer,
	nTileId,
	nTileX,
	nTileY;
 
	for (var nLayers = 0; nLayers < aLayersLen; nLayers += 1)
	{
		CurrentContext = ctxCanvasMap[nLayers];
		CurrentLayer = Layers[nLayers].data;

		var PosX = 0;
		var PosY = 0;
		
		for (var nDataCount = 0; nDataCount < CurrentLayer.length; nDataCount += 1)
		{
			
			nTileId = CurrentLayer[nDataCount];
			nTileX = Math.floor(nTileId % nImageCols) -1;
			if (nTileX !== -1)
			{
				nTileX *= TileWidth;
				nTileY = Math.floor(nTileId / nImageCols);
				nTileY *= nTileHeight;
				
				CurrentContext.drawImage(img, nTileX, nTileY, TileWidth, nTileHeight, PosX, PosY, TileWidth, nTileHeight);
			}
			
			PosX += TileWidth;
			if (PosX === nMapWidth)
			{
				PosX = 0;
				PosY += nTileHeight;
			}
		}
	}
};